import React, {Component} from 'react';
import {Route, Switch} from 'react-router-dom'

import Dashboard from "./containers/Dashboard/Dashboard";

class App  extends Component {
  render() {
    return (
      <div>
        <Route path='/dashboard' component={Dashboard} exact/>
      </div>
  );
}
}

export default App;
